COUNTRY:
create or replace TABLE COUNTRY (
	"id" NUMBER(38,0),
	"name" VARCHAR(16777216)
);

LEAGUE:
create or replace TABLE LEAGUE (
	"id" NUMBER(38,0),
	"country_id" NUMBER(38,0),
	"name" VARCHAR(16777216)
);

SQLITE_SEQUENCE:
create or replace TABLE SQLITE_SEQUENCE (
	"name" VARCHAR(16777216),
	"seq" NUMBER(38,0)
);
